import { Container } from 'react-bootstrap';
import './App.css';
import { BrowserRouter } from 'react-router';

function App() {
  return (
    <Container className='revv-main-container p-0 vh-100' fluid>
    <BrowserRouter>
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
      </header>
    </div>
    </BrowserRouter>
    </Container>
  );
}

export default App;
